import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter as Router } from 'react-router-dom';

import { Posts, Title } from './components';

const App = () => {

  return <Router>
      <div className="app">
        <Title />
        <Posts />
      </div>
  </Router>
}

ReactDOM.render(<App />, document.getElementById("app"));
